// start easter egg, down up down up left right left right b a rawr!
var locked = false;
var raptor = $("#easter-egg");
function rawr() {
    locked = true;
    raptor
        .animate({
            "bottom": "0"
        }, function () {
            $(this)
                .animate({
                    "bottom": "-130px"
                }, 100, function () {
                    var offset = (($(this).position().left) + 400);
                    $(this)
                        .delay(300)
                        .animate({
                            "right": offset
                        }, 2200, function () {
                            raptor = $('#easter-egg').css({"bottom": "-700px", "right": "0"});
                            locked = false
                        })
                })
        })
}

/**
 * Lazy load the images, I'm debating if I could make it even lazier by loading images past like 1200px down to
 * wait until the page is scrolled to maybe 500px or so
 */
function init_imgs()
{
	var imgDefer = document.getElementsByTagName('img');
	for (var i=0; i<imgDefer.length; i++) {
		if(imgDefer[i].getAttribute('data-src')) {
			imgDefer[i].setAttribute('src',imgDefer[i].getAttribute('data-src'));
		}
	}
}
window.onload = init_imgs;
var easter_egg = new Konami(function() { setTimeout(rawr, 1000); });

/**
 * Not used yet, but will probably add for easter egg too
 */
function barrel_roll() {
	$('body').addClass('barrel_roll');
	setTimeout("$('body').removeClass('barrel_roll')", 4000);
}

/**
 * Handles the heavy lifting by reading the work history and client recommendations and compiling
 * it into html using handlebars template system.
 */
$.getJSON("/js/data.json", function(data){
	// sets variable source to the animalTemplate id in index.html
	var source = document.getElementById("job-template").innerHTML;

	// Handlebars compiles the above source into a template
	var template = Handlebars.compile(source);

	// data is passed to above template
	var output = template(data);

	// HTML element with id "animalList" is set to the output above
	document.getElementById("job-list").innerHTML = output;

	source = document.getElementById("recommendations-template").innerHTML;
	template = Handlebars.compile(source);
	output = template(data);
	document.getElementById("recommendations-list").innerHTML = output;

}).fail(function() {
	console.log( "error loading js/data.json" );
})
